import React from 'react';
import { Container } from './styled';

const Page = () => {
    return (
        <Container>
            <form className='formulario'>
                <label>
                    Nome:
                </label>
                <input type="Text" name="nomeCampeonato" />
                <label>
                    Data inicio:
                </label>
                <input type="Text" name="nomeCampeonato" />
                <label>
                    Data fim:
                </label>
                <input type="Text" name="nomeCampeonato" />
                <input type="submit" value="Cadastrar" />
            </form>
        </Container>
    );
}

export default Page;
